    return (
        <div>
            <div style={{height: '500px'}}>
            <img src={pic} style={{position: 'absolute', top: '0', width: '100%'}} alt="this is image"></img>

            <div id="navBar">
                <h1>React-demo</h1>
            </div>
            </div>
        </div>
    )
}
